package webproject.dto;

public class SearchDTO {

	private int account_Num;
	private String account_Id;
	private String account_Name;
	private String account_Img;
	private String account_Follow; 
	
	
	public SearchDTO() {
		// TODO Auto-generated constructor stub
	}


	public int getAccount_Num() {
		return account_Num;
	}


	public void setAccount_Num(int account_Num) {
		this.account_Num = account_Num;
	}


	public String getAccount_Id() {
		return account_Id;
	}


	public void setAccount_Id(String account_Id) {
		this.account_Id = account_Id;
	}


	public String getAccount_Name() {
		return account_Name;
	}


	public void setAccount_Name(String account_Name) {
		this.account_Name = account_Name;
	}


	public String getAccount_Img() {
		return account_Img;
	}


	public void setAccount_Img(String account_Img) {
		this.account_Img = account_Img;
	}


	public String getAccount_Follow() {
		return account_Follow;
	}


	public void setAccount_Follow(String account_Follow) {
		this.account_Follow = account_Follow;
	}
	
}
